import React, { Component } from 'react';

export class StyleItem extends Component {
    render() {
        const { style } = this.props;
        return (
            <div>
                {style.map(styleLink => (
                    <a href="">{style.name}</a>
                ))}
            </div>
        )
    }
}

export default StyleItem;
